/** @format */

import React from "react";
import "./Winner.css";

function Winner({ onRestart }) {
  return (
    <div className="WinningGame">
      <h2>WINNER WINNER CHICKEN DINNER</h2>
      <button onClick={onRestart}>Restart</button>
    </div>
  );
}

export default Winner;
